(26, 'Home', '<p>One of UK''s finest independent and contemporary Estate agent.<br /><br /> Rowflex specializes in buying, selling, letting or renting a home in your area. We are renowned for applying the highest standards of quality and integrity in all our property services, our reputation for uncompromising professionalism in everything we do is earned everyday by serving our clients and earning their trust.<br /><br /> Rowflex has an unrivalled choice of properties available to our clients all the time. Maybe you are a first time buyer looking for a house or a flat to accommodate your family or even a cottage in the countryside for when you retire. With new instructions coming to us on a daily basis, we are confident that Rowflex can help you find a suitable home for you and your family.</p>', 1, 'Home', 'Home', 31, 0, '2016-07-21 12:41:27', '0', '', '', 'home', '', 1, 'Rowflex Property Management Services.', 1, 0, 0, '', 0, 1, ' \r\n '),
