(69, 'Guaranteed Rent', '<img class="pull-left inner_ima" alt="" src="../wtos-images/ienei6.png" /> <br />\r\n<p><span style="color: #000000;"><strong>How does it work?</strong>&nbsp;<br /><br />Once one of our experienced team has valued your property, we will make an offer to you for a period of 1-3 years. We will usually agree to start the contract one month after acceptance of our offer, but in certain circumstances we can begin the contract earlier.&nbsp;&nbsp;Once the contract has begun you will be paid the agreed amount each month regardless of whether the property is tenanted or not, and even if the residing tenant stops paying the rent or falls into arrears.&nbsp;<br /><br />There are no fees or commission payable with the scheme, you receive the full agreed amount each month on the same day each month, for the full term of the contract.<br /><br /><br /><strong><br /></strong></span></p>\r\n<img class="pull-right inner_ima" alt="" src="../wtos-images/ienei3.png" />\r\n<p><span style="color: #000000;"><strong>Tenant?</strong><br /><br />Expand Properties will be your tenant and we take on all of the contractual responsibilities of the tenancy. This not only includes paying the rent, but also includes the obligation to look after the property in a tenant-like manner.<br /><br />Expand Properties own and manage a portfolio of properties throughout London, giving us a unique background that enables us to manage your property and look after your best interests.<br /><br />Once we have signed a contract with you we will start work on sourcing a tenant. As we have ultimate responsibility for the property we take special care in finding the highest quality of tenant, and most tenants that we place in properties are city professionals. We fully reference all tenants before offering a property and only accept tenants with an impeccable background.<br /><br />Our organisation also has links with a number of large corporations and we are often asked to arrange tenancies for employees and their families.<br /><br /><br /><strong>What happens at the end of the contract?</strong><br /><br />Approximately two months prior to the end of the contract we will write to you offering a further contact, or giving you the option to take back possession of the property. If a new contract is signed more than one month prior to the end of the initial contract then we will guarantee that the new contract runs concurrently following the expiry of the initial contract. There are no renewal fees or charges for extending the contract.<br /><br /><br /><strong>Preparing the Property</strong><br /><br />Once the property becomes vacant we will prepare a full inventory that includes colour photographs in order to establish an accurate record of the condition of the property at the point it is handed over to us. The inventory will be prepared by us at no charge to you and it will be checked by a professional inventory clerk at the end of the contract when the property is eventually returned to you.<br /><br />To comply with current legal obligations, we require you to provide a current landlords gas safety certificate and an energy performance certificate, prior to the start of the contract. If you prefer we can arrange these certificates on your behalf and deduct the cost from your first rent payment. The gas safety certificate needs to be renewed each year but we will make these arrangements on your behalf and we will cover the cost of this.<br /><br /><br /><strong>Property Management</strong><br /><br />As part of our obligation to ensure that the property is being looked after by the occupier, we will make regular inspections of the property and we will report any maintenance issues to you. In the event that maintenance or repair work is required we will inform you of the issue and allow you a reasonable amount of time in order to arrange a contractor to carry out the works. Alternatively, if you prefer, we will arrange for one of our trusted contractors to carry out the works on your behalf, and once the work has been completed we will settle the contractor&rsquo;s invoice and deduct the cost from your next rent payment. <img class="pull-right inner_ima" alt="" src="../wtos-images/ienei5.png" /> <br /><br /><br /><strong>Advantages of the Scheme</strong></span></p>\r\n<span style="color: #000000;">* No Voids or Vacant Periods&nbsp;<br />* Guaranteed Fixed Monthly Rent &ndash; No Late or Missed Payments&nbsp;<br />* Formal Offer from us within 24 hours&nbsp;<br />* 1 - 3 Year Contracts&nbsp;<br />* No Lettings Agency Commission&nbsp;<br />* No Management Fees&nbsp;<br />* No Renewal Fees&nbsp;<br />* No Rent Insurance Premiums&nbsp;<br />* No Utility Bills or Council Tax to Pay&nbsp;<br />* Includes Full Inventory &amp; Check-Out Report&nbsp;<br />* Includes the Renewal of your Annual Gas Safety Certificate&nbsp;<br />* Includes End of Tenancy Cleaning&nbsp;<br /></span> <span style="color: #000000;">Expand Properties offer a unique service to landlords allowing you to fix your income and costs, whilst giving you the reassurance that the property is being looked after by experienced professionals.<br /><br />We pride ourselves on offering a first class service that takes the stress out of owning an investment property. We choose only the highest quality of tenant because ultimately we are responsible for the property, and having this vested interest means that we will manage your property as if it was one of our own properties, giving you a personal service that we are confident is superior to that offered by any other managing agent.<br /><br />We are happy to consider any property providing that it meets our basic standard and is fully self-contained. Where a property requires refurbishment we may be able to renovate the property at our expense, and furnish properties as required.</span>\r\n<div class="clear">&nbsp;</div>', 1, 'Guaranteed Rent', 'Guaranteed Rent', 26, 0, '2015-12-03 12:48:54', '0', '', '', 'Guaranteed-Rent', '', 6, 'Guaranteed Rent', 1, 0, 0, '', 0, 1, ''),
(70, 'cookiepolicy', '<div class="cookiePolicy">\r\n<h2>Privacy Statement: How we use Cookies</h2>\r\n<p>Cookies are very small text files that are stored on your computer when you visit some websites. <br /><br /> We use cookies to help identify your computer so we can tailor your user experience, track shopping basket contents and remember where you are in the order process. <br /> You can disable any cookies already stored on your computer, but these may stop our website from functioning properly.<br /> The following is strictly necessary in the operation of our website. <br /> This Website Will: <br />Remember what is in your shopping basket<br /> Remember where you are in the order process<br /> Remember that you are logged in and that your session is secure. You need to be logged in to complete an order.<br /> The following are not Strictly Necessary, but are required to provide you with the best user experience and also to tell us which pages you find most interesting (anonymously). </p>\r\n<h2>Functional Cookies</h2>\r\n<p>This Website Will:<br /> Offer Live Chat Support (If available)<br /> Track the pages you visits via Google Analytics</p>\r\n<h2>Targeting Cookies</h2>\r\n<p>This Website Will:<br />Allow you to share pages with social networks such as Facebook (If available)<br /> Allow you to share pages via Add This (If available)<br /> To view the &lsquo;Add This&rsquo; Privacy Policy or to opt out of any online behavioural advertising, please visit Add This and click on the &lsquo;Opt Out&rsquo; button.<br /> This website will not<br /><br /> Share any personal information with third parties.</p>\r\n<p>&nbsp;</p>\r\n</div>', 1, 'cookiepolicy', 'cookiepolicy', 26, 0, '2015-12-03 01:50:18', '0', '', '', 'cookiepolicy', '', 0, 'Cookies Policy', 0, 0, 0, '', 0, 1, ''),
(71, 'About Us', '<div class="container">\r\n<p>To be the agent of choice for anyone considering a property related transaction by being the best in our profession. We provide an outstanding level of service to our clients, making moving an easy seamless and pleasurable experience. This is delivered by making clients feels special and by providing a full range of services.</p>\r\n<p>We believe in clients for life and will stay in contact with clients long after their transaction has concluded so we remain the agent of choice. 50% of our business will come from recommendations and referrals by delivering exceptional service and simply asking for the business.</p>\r\n<p><strong>OUR CLIENTS</strong> &ndash; are the most important part of our business. Our main focus is to deliver outstanding service, making moving an easy, seamless &amp; pleasurable experience.</p>\r\n<p><strong>OUR TEAM </strong>&ndash; is our most valuable asset and we work together in an atmosphere of fun and respect. We support each other to deliver exceptional customer care and achieve our personal goals.</p>\r\n<p><strong>OUR BUSINESS </strong>&ndash; provides a one-stop service for all property related matters. Our business is built on 7 strong principles and we have a shared vision to be the best in our profession both in terms of service and results.</p>\r\n<img class="pull-right" alt="" src="&lt;? echo $site[''site'']; ?&gt;wtos-images/ienei6.png" />\r\n<ul>\r\n<li>INTEGRITY</li>\r\n<li>TEAMWORK</li>\r\n<li>PASSION</li>\r\n<li>PROFESSIONALISM</li>\r\n<li>FUN</li>\r\n<li>CARING</li>\r\n<li>INDUSTRIOUS</li>\r\n</ul>\r\n<div class="clearfix">&nbsp;</div>\r\n</div>', 0, 'aboutUs', 'aboutUs', 31, 0, '2016-07-25 01:56:37', '0', '', '', 'aboutUs', '', 12, 'About Us', 1, 0, 0, '', 0, 1, '');
