(1, 'Holiday Lets', 'holidayLets', 1, '', '', '<div class="block"><a href="#"><img alt="" src="../wtos-images/Holiday_Lets.png" /></a>\r\n<h2>Holiday Lets</h2>\r\n<p>Rowflex Holiday Homes, provides a range of affordable self service holiday accommodation. (Short Let Accommodation) tions in and around London, ranging from single rooms, en suite rooms ...</p>\r\n<a class="button" href="#">Read More</a></div>', 1, 31, '2016-07-21 12:34:40', 0, 0),
(2, 'Morgages', 'morgagesBox', 2, '', '', '<div class="block"><a href="#"><img alt="" src="../wtos-images/Mortgages.png" /></a>\r\n<h2>Mortgages</h2>\r\n<p>We realise that in this current economic climate your mortgage is one of the most important aspects of the property transaction. You need a mortgage that is tailored to your lifestyle and income, so that ...</p>\r\n<a class="button" href="#">Read More</a></div>', 1, 31, '2016-07-21 12:37:36', 0, 0),
(3, 'Landlord Box', 'landlordBox', 1, '', '', '<div class="block"><a href="holidayLets"><img alt="" src="../wtos-images/Landlords.png" /></a>\r\n<h2>Landlords</h2>\r\n<p>At Rowflex we guarantee any landlord the best tenants that will look after your property like their own, because we are always there to make sure your property stays the same, to gain market value...</p>\r\n<a class="button" href="holidayLets">Read More</a></div>', 1, 31, '2016-07-25 02:43:10', 0, 0);
